import { CommonModule } from '@angular/common';
import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [
    CommonModule,
    Rou
  ],
  template: `<router-outlet></router-outlet>`,
  styles: []
})
export class AppComponent {
  title = 'FASystemClient';
}
